import React, { Component } from 'react'
import Pictures from './Pictures'
import Container from 'react-bootstrap/Container'
import Header from './Header'

export default class Home extends Component {
    render() {
        return (
            <Container>
                <Header></Header>
                <Pictures></Pictures>
            </Container>
        )
    }
}
